export const setLanguage = (value) => ({
  type: "SET_LANGUAGE",
  payload: value,
});

export const setOrderDetailPageDefaultTab = (value) => ({
  type: "SET_DEFAULT_TAB",
  payload: value,
});

export const setHistoryPage = (value) => ({
  type: "SET_HISTORY_PAGE",
  payload: value,
});
